import React from 'react';
import Timeline from 'timeline';

function About() {
    return (
        <React.Fragment>
            <h1>About</h1>

            <div style={horizontalStyle()}>
                <p>UI update in Header.js file. Notes</p>
                <ul>
                    <li>Changed background color</li>
                    <ul></ul>
                </ul>
            </div>

            <div>
                <p>ToDoList app v1</p>
            </div>
        </React.Fragment>
    )
}

export default About
